import React, { Component } from 'react';

import modal4 from '../images/modal4.png'

import { bindActionCreators } from 'redux'; 
import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';

import { 

} from '../actions/index';


class Banner extends Component {

	category(){
		this.props.history.push('/category')
	}


	render(){
		let categoryLabels

		if(this.props.categories){
			if(this.props.categories.rows){
				categoryLabels = this.props.categories.rows.map(category => {
					return (
						<div onClick={this.category.bind(this)} key={category.category_id} className='col-4'>
							<h3 className='white'>{category.name}</h3>
						</div>
					)
				})
			}
		}


		return(
	     	<div style={{position:'relative', display:'flex', alignItems:'center', height:'336px'}}>
	     		<div style={{left:'0', position:'absolute', width:'100%', padding:'60px'}}>
	     			<div>
	     				<h1>Mens wear</h1>
	     			</div>

	     			<div className='row' style={{width:'75%'}}>
		     			{categoryLabels}
	     			</div>
	     		</div>

	     		<div style={{width:'100%', height:'100%', overflow:'hidden'}}>
	     			<img style={{width:'100%'}} src={modal4}/>
	     		</div>
	     	</div>
		);
	}
}


function mapStateToProps(state){
	return { 
		categories:state.categories.categories
	};
}

const mapDispatchToProps = (dispatch) => {
	return bindActionCreators({

	}, dispatch);
};


Banner = connect(mapStateToProps, mapDispatchToProps)(Banner);

export default withRouter(Banner);
